window.CUCUMBER_MESSAGES = [{"meta":{"protocolVersion":"19.1.2","implementation":{"name":"cucumber-jvm","version":"7.8.0"},"runtime":{"name":"OpenJDK 64-Bit Server VM","version":"17.0.5+8"},"os":{"name":"Windows 11"},"cpu":{"name":"amd64"}}},{"testRunStarted":{"timestamp":{"seconds":1677446460,"nanos":742520900}}},{"source":{"uri":"classpath:features/RetailOrder.feature","data":"@test\nFeature: Retail Order Page\n\n  Background: \n    Given User is on retail website\n    When User click on Sign in option\n    And User enter email 'khris@gmail.com' and password '1234@Qwer'\n    And User click on login button\n    And User should be logged in into Account\n    And User change the category to 'Electronics'\n    And User search for an item 'Apex Legends'\n    And User click on Search icon\n    And User click on item\n    And User select quantity '2'\n    And User click add to Cart button\n    Then The cart icon quantity should change to '2'\n    And User click on Cart option\n    And User click on Proceed to Checkout button\n    # add card and address\n    And User click Add a new address link for shipping address\n    And User fill new address form with below information\n      | country | fullName | phoneNumber | streetAddress | apt | city | state | zipCode |\n    And User click Add Your Address button\n    And User click Add a credit card or Debit Card for Payment method\n    And User fill Debit or credit card information\n      | cardNumber | nameOnCard   | expirationMonth | expirationYear | securityCode |\n      | cardNumber | fullName     |               6 |           2023 | securityCode |\n    And User click on Add your card button\n    #end of added block\n    And User click on Place Your Order\n    #the btn is unable to click unless you add address and credit card\n    #so needs more steps like \"add credit card\" and \"add address\"\n    And User click on Place Your Order\n    Then A message should be displayed ‘Order Placed, Thanks’\n    And User click on Orders section\n  \tAnd User click on first order in list\n  \n  Scenario: Verify User can cancel the order\n    And User click on Cancel The Order button\n    And User select the cancelation Reason 'Bought wrong item'\n    And User click on Cancel Order button\n    Then A cancelation message should be displayed ‘Your Order Has Been Cancelled’\n\n  Scenario: Verify User can Return the order\n    And User click on Return Items button\n    And User select the Return Reason 'Item damaged'\n    And User select the drop off service 'FedEx'\n    And User click on Return Order button\n    Then A cancelation message should be displayed ‘Return was successful’\n\n  Scenario: Verify User can write a review on order placed\n    And User click on Review button\n    And User write Review headline 'headline value' and 'review text'\n    And User click Add your Review button\n    Then A review message should be displayed ‘Your review was added successfully’\n","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"classpath:features/RetailOrder.feature","feature":{"location":{"line":2,"column":1},"tags":[{"location":{"line":1,"column":1},"name":"@test","id":"47696797-08af-4032-8063-497ff830cf49"}],"language":"en","keyword":"Feature","name":"Retail Order Page","description":"","children":[{"background":{"location":{"line":4,"column":3},"keyword":"Background","name":"","description":"","steps":[{"location":{"line":5,"column":5},"keyword":"Given ","keywordType":"Context","text":"User is on retail website","id":"81dfa116-781d-45d5-a5db-8982bfb094f8"},{"location":{"line":6,"column":5},"keyword":"When ","keywordType":"Action","text":"User click on Sign in option","id":"fc50e338-13fd-4cca-9bda-6918a77dded3"},{"location":{"line":7,"column":5},"keyword":"And ","keywordType":"Conjunction","text":"User enter email 'khris@gmail.com' and password '1234@Qwer'","id":"984d2541-c2cd-4ff9-afe1-d0432c0acfbc"},{"location":{"line":8,"column":5},"keyword":"And ","keywordType":"Conjunctio
